      '<h3><i><strong>ວັນທີ 14 ມິຖຸນາ ຂອງທຸກໆປີ</strong></i></h3><p>&nbsp;ເປັນວັນແຫ່ງການສະເຫຼີມສະຫຼອງ ວັນຜູ້ບໍລິຈາກເລືອດໂລກ (World Blood Donor Day – WBDD) ໃນປະເທດຕ່າງໆທົ່ວໂລກ ເພື່ອເປັນການຂອບໃຈຜູ້ບໍລິຈາກເລືອດທົ່ວໂລກ ທີ່ໄດ້ມອບຂອງຂວັນທີ່ມີຄ່າຕໍ່ຊີວິດ ຄື ການບໍລິຈາກເລືອດ ດ້ວຍຄວາມສະໝັກໃຈເພື່ອຊ່ວຍຄົນເຈັບ ແລະສ້າງຄວາມສໍານຶກໃນເລື່ອງຄວາມຈໍາເປັນຂອງການບໍລິຈາກເລືອດປະຈໍາ ທີ່ສະໝໍ່າສະເໝີ. ເລືອດແມ່ນ ບໍ່ສາມາດທີ່ຈະຜະລິດຫລືເອົາສານອັນອື່ນມາທົດແທນໄດ້ ມີແຕ່ເລືອດຂອງມະນຸດເຮົາເທົ່ານັ້ນ ທີ່ຈະບໍລິຈາກຊ່ວຍຊີວິດເພື່ອມະນຸດດ້ວຍກັນ</p><blockquote><figure class="media"><oembed url="https://www.facebook.com/475164072571176/videos/1205959263166489/?t=2"></oembed></figure></blockquote>',
